import{_ as n,o as s,c as a,z as e,a as t}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 3.2-6045 Livestock and Poultry Disease Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-6045.md","filePath":"vacode/3.2-6045.md"}'),r={name:"vacode/3.2-6045.md"},o=e("h1",{id:"§-3-2-6045-livestock-and-poultry-disease-fund",tabindex:"-1"},[t("§ 3.2-6045 Livestock and Poultry Disease Fund. "),e("a",{class:"header-anchor",href:"#§-3-2-6045-livestock-and-poultry-disease-fund","aria-label":'Permalink to "§ 3.2-6045 Livestock and Poultry Disease Fund."'},"​")],-1),i=e("p",null,'There is hereby created in the state treasury a special nonreverting fund to be known as the Livestock and Poultry Disease Fund, referred to in this section as "the Fund." The Fund shall be established on the books of the Comptroller. All civil penalties assessed pursuant to this chapter shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. Moneys in the Fund shall be used to carry out the purposes of this chapter. Expenditures and disbursements from the Fund shall be made by the State Treasurer on warrants issued by the Comptroller upon written request signed by the Commissioner.',-1),d=e("p",null,[t("2016, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0563",target:"_blank",rel:"noreferrer"},"563"),t(".")],-1),l=[o,i,d];function h(c,u,p,f,m,_){return s(),a("div",null,l)}const v=n(r,[["render",h]]);export{y as __pageData,v as default};
